import React from "react";
import './backPage.css';

function BackPage() {
  const table = {
    borderCollapse: "collapse",
    width: "100%",
  };
  const tdth = {
    border: "1px solid black",
    padding: "5px",
    maxWidth: "40px",
  };

  return (
    <div className="front-page">
      <div className="front-half-1 back-page">
        <table>
          <tr>
            <th>Сана</th>
            <th>Хайдовчи Ахволи</th>
            <th>Транспорт ҳолати</th>
            <th>Кунлик тўлов</th>
            <th>Чиқиш вақти</th>
            <th>Кириш вақти</th>
          </tr>
          <tr>
            <td>14.10.2022</td>
            <td></td>
            <td></td>
            <td></td>
            <td></td>
            <td></td>
          </tr>
        </table>
      </div>
    </div>
  );
}

export default BackPage;
